import React, { useState, Component } from "react";
import Typography from "@mui/material/Typography";
import Grid from "@mui/material/Grid";
import Card from "@mui/material/Card";
import CardContent from "@mui/material/CardContent";
import CardMedia from "@mui/material/CardMedia";
import Box from "@mui/material/Box";
import { cardContent, cardMedia } from "./Team";
import { Button } from "@mui/material";
import ServiceData from "./ServicesData";
import CustomCard from "./CustomCard";
import SimpleSlider from "./SimpleSlider";
import DestinationData from "./DestinationData";
import DestinationCard from "./DestinationCard";
import Logos from "./Logos";
import Newsletter from "./Newsletter";
import Footer from "./Footer";
import "./App.css";

const Home = () => {
  const [selectedCategory, setSelectedCategory] = useState("All");

  const filterProducts = (category) => {
    if (category.includes("All")) {
      return ServiceData;
    } else {
      return ServiceData.filter((product) =>
        product.category.some((pro) => category.includes(pro))
      );
    }
  };

  const filterDestinations = (categories) => {
    if (categories.includes("All")) {
      return DestinationData;
    } else {
      return DestinationData.filter((destination) =>
        destination.category.some((cat) => categories.includes(cat))
      );
    }
  };

  return (
    <>
      <Box sx={{ flexGrow: 1 }}>
        <Grid container sx={{ mt: 3 }}>
          <Grid item={12} style={{ position: "relative" }}>
            <img
              src="../images/image3.png"
              alt=""
              style={{ width: "100%", height: "400px" }}
            />
            <Typography
              variant="h5"
              component="h5"
              style={{
                position: "absolute",
                top: "40%",
                left: "50%",
                transform: "translate(-50%, -50%)",
                fontWeight: 800,
                color: "white",
              }}
            >
              Explore the world together
            </Typography>

            <Typography
              variant="p"
              component="p"
              style={{
                position: "absolute",
                top: "60%",
                left: "50%",
                transform: "translate(-50%, -50%)",
                color: "white",
                fontSize: "20px",
              }}
            >
              Find awesome flights, hotel, tour, car and packages
            </Typography>
          </Grid>

          <Grid container spacing={2} sx={{ mt: 3 }}>
            <Grid
              item
              xs={12}
              sm={6}
              md={3}
              sx={{
                p: 2,
                display: "flex",
                alignItems: "center",
                flexDirection: "column",
                justifyContent: "center",
                minHeight: "250px",
              }}
            >
              <Typography variant="h4" sx={{ textAlign: "center" }}>
                Go beyond your imagination
              </Typography>
              <Box
                sx={{
                  position: "relative",
                  "&::after": {
                    content: '""',
                    position: "absolute",
                    width: "200px",
                    height: "1px",
                    background: "#8b3eea",
                    left: "calc(50% - 100px)",
                    top: "20px",
                  },
                }}
              />
              <br />
              <br />
              <Typography
                variant="h6"
                sx={{ textAlign: "center", fontSize: "18px" }}
              >
                Discover your ideal experience with us
              </Typography>
            </Grid>

            <Grid item xs={12} sm={6} md={3}>
              <CardMedia
                component="div"
                className="scaleEffect"
                sx={{ position: "relative", paddingTop: "100%" }}
              >
                <img
                  src="images/image21.png"
                  alt=""
                  style={{
                    position: "absolute",
                    top: "0",
                    left: "0",
                    width: "100%",
                    height: "130%",
                    objectFit: "cover",
                  }}
                />
                <Typography
                  variant="h6"
                  className="content"
                  style={{
                    position: "absolute",
                    bottom: 0,
                    width: "100%",
                    color: "white",
                    textAlign: "center",
                    fontSize: "25px",
                    // padding: "8px",
                  }}
                >
                  7% Discount for All Airlines
                </Typography>
              </CardMedia>
            </Grid>

            <Grid item xs={12} sm={6} md={3}>
              <CardMedia
                component="div"
                className="scaleEffect"
                sx={{ position: "relative", paddingTop: "100%" }}
              >
                <img
                  src="images/image22.png"
                  alt=""
                  style={{
                    position: "absolute",
                    top: "0",
                    left: "0",
                    width: "100%",
                    height: "130%",
                    objectFit: "cover",
                  }}
                />
                <Typography
                  variant="h6"
                  className="content"
                  style={{
                    position: "absolute",
                    bottom: 0,
                    width: "100%",
                    color: "white",
                    textAlign: "center",
                    fontSize: "25px",
                    // padding: "8px",
                  }}
                >
                  Travel around the world
                </Typography>
              </CardMedia>
            </Grid>

            <Grid item xs={12} sm={6} md={3}>
              <CardMedia
                component="div"
                className="scaleEffect"
                sx={{ position: "relative", paddingTop: "100%" }}
              >
                <img
                  src="images/image23.png"
                  alt=""
                  style={{
                    position: "absolute",
                    top: "0",
                    left: "0",
                    width: "100%",
                    height: "130%",
                    objectFit: "cover",
                  }}
                />
                <Typography
                  variant="h6"
                  className="content"
                  style={{
                    position: "absolute",
                    bottom: 0,
                    width: "100%",
                    color: "white",
                    textAlign: "center",
                    fontSize: "25px",
                    // padding: "8px",
                  }}
                >
                  Luxury resorts top deals
                </Typography>
              </CardMedia>
            </Grid>
          </Grid>

          <Grid container sx={{ mt: 3, pr: 3, pl: 3 }}>
  <Grid item xs={12}>
    <Box sx={{ p: 3, mt: 5 }}>
      <Typography
        variant="h4"
        component="h4"
        sx={{
          fontWeight: 700,
          textAlign: "center",
          position: "relative",
        }}
      >
        Top destinations
      </Typography>
      <Box
        sx={{
          position: "relative",
          "&::after": {
            content: '""',
            position: "absolute",
            width: "200px",
            height: "1px",
            background: "#8b3eea",
            left: "calc(50% - 100px)",
            top: "20px",
          },
        }}
      />
    </Box>
  </Grid>
  {Array.from(Array(8)).map((_, index) => (
    <Grid item xs={12} sm={6} md={6} lg={3} key={index}>
      <div className="colorEffectOverlay">
        <Card sx={{ height: "100%", display: "flex", flexDirection: "column" }}>
          <CardMedia
            component="div"
            sx={{
              position: "relative",
              paddingTop: "100%",
              height: 0,
            }}
          >
            <img
              src={`images/image2${24 + index}.png`}
              alt=""
              style={{
                position: "absolute",
                top: "0",
                left: "0",
                width: "100%",
                height: "100%",
                objectFit: "cover",
              }}
            />
            <Typography
              variant="h6"
              component="h6"
              sx={{
                position: "absolute",
                bottom: 0,
                width: "100%",
                color: "white",
                textAlign: "center",
                padding: "8px",
                backgroundColor: "rgba(0, 0, 0, 0.7)",
                backdropFilter: "blur(5px)",
              }}
            >
              {[
                "Up to 50% Off Holiday packages",
                "China",
                "Darjeeling",
                "Malaysia",
                "Gangtok",
                "Thailand",
                "Australia",
                "London",
                "USA",
              ][index]}
              {index === 0 && (
                <Button
                  variant="contained"
                  size="large"
                  color="secondary"
                  sx={{
                    marginTop: "10px",
                  }}
                >
                  Book Now
                </Button>
              )}
            </Typography>
          </CardMedia>
        </Card>
      </div>
    </Grid>
  ))}
  <Grid item xs={12} sm={12} md={12} lg={12}>
    <CardMedia
      component="div"
      sx={{
        position: "relative",
        paddingTop: "100%",
        height: 0,
      }}
    >
      <Button
        variant="contained"
        color="secondary"
        sx={{
          padding: "15px",
          width: "100%",
          marginTop: "10px",
          borderRadius: "20px",
          ":hover": {
            backgroundColor: "#212529",
          },
        }}
      >
        View All
      </Button>
    </CardMedia>
  </Grid>
</Grid>
>
            <Grid item xs={12}>
              <Box sx={{ p: 5, mt: 5 }}>
                <Typography
                  variant="h4"
                  component="h4"
                  sx={{
                    fontWeight: 700,
                    textAlign: "center",
                    position: "relative",
                  }}
                >
                  Explore our hot deals
                </Typography>
                <Box
                  sx={{
                    position: "relative",
                    "&::after": {
                      content: '""',
                      position: "absolute",
                      width: "200px",
                      height: "1px",
                      background: "#8b3eea",
                      left: "calc(50% - 100px)",
                      top: "20px",
                    },
                  }}
                />
              </Box>
            </Grid>

            <div
              style={{
                display: "flex",
                justifyContent: "center",
                margin: "15px auto",
              }}
            >
              <Button
                variant={
                  selectedCategory === "Hotels" ? "contained" : "outlined"
                }
                color="secondary"
                sx={{ margin: "8px" }}
                onClick={() => setSelectedCategory("Hotels")}
              >
                Hotels
              </Button>
              <Button
                variant={
                  selectedCategory === "Tours" ? "contained" : "outlined"
                }
                color="secondary"
                sx={{ margin: "8px" }}
                onClick={() => setSelectedCategory("Tours")}
              >
                Tours
              </Button>
              <Button
                variant={
                  selectedCategory === "Space" ? "contained" : "outlined"
                }
                color="secondary"
                sx={{ margin: "8px" }}
                onClick={() => setSelectedCategory("Space")}
              >
                Space
              </Button>
              <Button
                variant={
                  selectedCategory === "Events" ? "contained" : "outlined"
                }
                color="secondary"
                sx={{ margin: "8px" }}
                onClick={() => setSelectedCategory("Events")}
              >
                Events
              </Button>
            </div>
            <Grid container spacing={2} sx={{ p: 2 }}>
              {filterProducts(selectedCategory).map((val, id) => (
                <Grid
                  item
                  xs={12}
                  sm={6}
                  md={3}
                  key={id}
                  className="scaleEffect"
                >
                  <CustomCard
                    image={val.image}
                    title={val.title}
                    rating={val.rating}
                    price={val.price}
                  />
                </Grid>
              ))}
            </Grid>
            <Grid container spacing={3} paddingRight={3}>
              <Grid item xs={12} sm={12} md={6}>
                <CardMedia
                  component="div"
                  className="colorEffectOverlay"
                  sx={{ position: "relative" }}
                >
                  <img
                    src="images/image41.png"
                    alt=""
                    style={{
                      width: "100%",
                      objectFit: "contain",
                      background: "none",
                    }}
                  />
                  <div
                    style={{
                      position: "absolute",
                      bottom: "15%",
                      left: "5%",
                      right: "5%",
                      padding: "8px",
                      color: "white",
                    }}
                  >
                    <Typography variant="h4">Special Offers</Typography>
                    <Typography variant="p">
                      Invidunt ut labore et dolore magna aliquyam erat, sed diam
                      voluptua. At vero eos et accusam et justo duo dolores et
                      ea rebum. Stet clita kasd dolor sit amet. Lorem ipsum
                      dolor sit amet.
                    </Typography>
                    <br />
                    <Button
                      variant="contained"
                      color="secondary"
                      sx={{ mt: 2 }}
                    >
                      Holiday Deals
                    </Button>
                  </div>
                </CardMedia>
              </Grid>

              <Grid item xs={12} sm={6} md={3}>
                <CardMedia
                  component="div"
                  className="colorEffectOverlay"
                  sx={{ position: "relative" }}
                >
                  <img
                    src="images/image42.png"
                    alt=""
                    style={{
                      width: "100%",
                      objectFit: "contain",
                      background: "none",
                    }}
                  />
                  <div
                    style={{
